PROGRAM _ErrorCB_PRG
VAR
	diag_state : lib500_types.DIAG_STATETYPE := lib500_types.DIAG_STATETYPE.DIAG_STATE_DISABLED;
	watchdog_state : lib500_types.DIAG_WD_STATETYPE := lib500_types.DIAG_WD_STATETYPE.DIAG_WD_STATE_UNKNOWN;
	error : lib500_types.DIAG_ERRORCODE := (error_code := lib500_types.DIAG_ERRORTYPE.DIAG_E_NOERROR, 
                                            device_num := lib500_types.DIAG_DEVICETYPE.DIAG_DEV_NONE,
                                            faulty_value := 0);
	return_code : lib500_types.IO_ERRORTYPE := lib500_types.IO_ERRORTYPE.IO_E_UNKNOWN;

	reaction : lib500_types.DIAG_REACTION := lib500_types.DIAG_REACTION.DIAG_ERR_SAFESTATE;

	call_count : UDINT := 0;
END_VAR

ST.xhtml:
(* get the reason for the error callback *) return_code := lib500.DIAG_CDS_GetErrorReason(ADR(diag_state), ADR(watchdog_state), ADR(error));
(* custom handler code can be placed here *)
(* the choices for the reactions are: -> lib500_types.DIAG_REACTION.DIAG_ERR_NOACTION -> lib500_types.DIAG_REACTION.DIAG_ERR_SAFESTATE -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_SSW0 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_SSW1 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_SSW2 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS00 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS01 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS02 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS03 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS04 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS05 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS06 -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_HS07
it's also possible to combine (binary-or) reactions, like: -> lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_SSW0 OR lib500_types.DIAG_REACTION.DIAG_ERR_DISABLE_SSW1 *)
(* pass the error reaction to the DIAG system *) lib500.DIAG_CDS_SetErrorReaction(reaction);
(* increment call count *) call_count := call_count + 1;

